import React from "react";

//COMPONENTS
import Header from "../components/Header";
import Section from "../components/Section";

export default class Home extends React.Component {
  render() {
    //notation passes along all props from the Home component to child components
    return (
      <div className="home-container">
        <Header myFunProp={"home container!"} />
        <Section title={"Mission"} text={message1}/>
        <Section title={"Who We Are"} text={message2} hasPhoto={true} photo={"group"}/>
      </div>
    );


  }
}

const message1 = "Transform the world through innovation and meaningful health" +
    "technology solutions that promote human welfare. Create meaningful impact" +
    " through innovative technology solutions that target thd world's most" +
    " pressing health issues.";

const message2 = "Founded in 2012"
